import React from 'react';

const SignUp = () => {
return (
	<div className="Contact">
		<h1>SignUp</h1>
		<form>
		<input type="text" placeholder='Username'/>
		<br/>
		
		<input type="password" placeholder='Password'/>
		<br/>
		<button>Submit</button>
		

		</form>


		
		


	

	<section className='row'></section>
	
	<div className="main">
		
	<img src='/Images/thali.svg' alt="Welcome to Maharaja Kitchen" />

                
	</div>
     
	<div className="main">
	<img src='/Images/Indian.webp' alt="Welcome to Maharaja Kitchen" />
                
	</div>
       
		
	
		
	</div>	
	
		
		
	
);
};

export default SignUp;
